import React, { Component } from 'react';
class PersonalCard extends Component{
    render() {
        return (
        <div>
            <h1>{this.props.lastName},{this.props.firstName} </h1>
        <p>age:{this.props.age}</p>
        <p>hair color : {this.props.hair}</p>
        </div>
        );
    }
}
    
export default PersonalCard;
